import React from 'react'
import { useSelector } from 'react-redux'

const Sidebar = () => {

  const isMenuOpen = useSelector((store) => store.app.isOpen);
  if(isMenuOpen) return null;

  return (
    <div className="w-1/12 p-8 shadow-lg">
      <h1>Subscriptions</h1>
      <ul>
        <li>Music</li>
        <li>Movies</li>
        <li>Gaming</li>
        <li>Sports</li>
      </ul>
    </div>
  )
}

export default Sidebar
